import { Route,Routes,link } from 'react-router-dom';
import './App.css';

function App() {
  return (
    <div className="App">
     <nav>
      <link to="/">hi</link>
      <a href="">hi</a>
      <a href="">hi</a>
      <a href="">hi</a>
     </nav>
     <Routes>
      <Route path='/' element={<App/>}/>
     </Routes>
    </div>
  );
}

export default App;
